import React from 'react';
import { Link, StyleSheet, View } from 'react-native';

const Navbar = () => {
  return (
    <View style={styles.header}>
      <Link title='Academy'></Link>
    </View>
  );
};

const styles = StyleSheet.create({
  header: {
    backgroundColor: 'orange',
    alignSelf: 'stretch',
    padding: 15
  },
  text: {
    fontSize: 30
  }
});

export default Navbar;
